  constructor(props){
    super(props)
    state={
      vegeta : 100, 
      goku : 100
    }
  }
  render(){
    return (
      <div className="App">
        <h1>Vegeta vs Goku</h1>
        <hr/>
        <div className='row'>
          <Vegeta name ="Vegeta"/>
          <Goku name="Goku"/>
        </div>
      </div>
    );
  }
}
export default App;
